import React from "react";

import classes from './Croquis.module.css'

function Croquis(props) {
  let forma = null;
  switch (props.respaldo.forma) {
    case "Rectangular":
      forma = (
        <svg
        className={classes.forma} 
          width="110"
          height="62"
          viewBox="0 0 110 62"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <rect
            x="0.5"
            y="0.5"
            width="108"
            height="61"
            fill="#white"
            stroke="#111"
            stroke-width="0.2px"
          />
        </svg>
      );
      break;
case "Capilla":
        forma = (
            <svg className={classes.forma}  width="110" height="63" viewBox="0 0 110 63" fill="none" xmlns="http://www.w3.org/2000/svg">
<path strokeWidth="0.2px" d="M0.5 62.5V13.8627C32.2711 -2.63155 78.7459 -3.42011 109.5 13.8515V62.5H0.5Z" fill="white" stroke="black"/>
</svg>
        );
        break;
case "Oval":
            forma = (
                <svg className={classes.forma}  width="110" height="62" viewBox="0 0 110 62" fill="none" xmlns="http://www.w3.org/2000/svg">
<path strokeWidth="0.2px" d="M55 0.5C70.1181 0.5 83.7802 3.95492 93.6454 9.51527C103.526 15.0843 109.5 22.6999 109.5 31C109.5 39.3001 103.526 46.9157 93.6454 52.4847C83.7802 58.0451 70.1181 61.5 55 61.5C39.8819 61.5 26.2198 58.0451 16.3546 52.4847C6.47403 46.9157 0.5 39.3001 0.5 31C0.5 22.6999 6.47403 15.0843 16.3546 9.51527C26.2198 3.95492 39.8819 0.5 55 0.5Z" fill="white" stroke="black"/>
</svg>

            );
            break;
case "Esquinas Redondas":
           forma = (
            <svg className={classes.forma} width="110" height="62" viewBox="0 0 110 62" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect strokeWidth="0.2px" x="0.5" y="0.5" width="109" height="61" rx="14.5" fill="white" stroke="#1a1a1a"/>
            </svg>
                );
                break;
    default:
        forma =<p className={classes.mensajeInicio}>Por favor seleccione una forma para comenzar</p>
      break;
  }
  return <div className={classes.Croquis}>
      {forma}
  </div>;
}

export default Croquis;
